import React, {Component} from 'react';

const Inputs = (Composant) => {
  class Inputs extends Component {
    constructor(props) {
      super(props);
      this.state = {
        selector : "row my-3 col-12 col-md-10"
      }
    }
  }
  return <Composant {...this.props}/>;  
}

export default Inputs;
